$(function () {
    'use strict'

    var ds = window.localStorage
    if (ds && ds.getItem('no_show') != null) {
        return
    }

    /**
     * Create ThemeQuarry ad
     */
    var wrapper_css = {
        'padding': '20px 30px',
        'background': '#f39c12',
        'display': 'none',
        'z-index': '999999',
        'font-size': '16px',
        'font-weight': 600
    }

    var link_css = {
        'color': 'rgba(255, 255, 255, 0.9)',
        'display': 'inline-block',
        'margin-right': '10px',
        'text-decoration': 'none'
    }

    var link_hover_css = {
        'text-decoration': 'underline',
        'color': '#f9f9f9'
    }

    var btn_css = {
        'margin-top': '-5px',
        'border': '0',
        'box-shadow': 'none',
        'color': '#f39c12',
        'font-weight': '600',
        'background': '#fff'
    }

    var close_css = {
        'color': '#fff',
        'font-size': '20px'
    }

    var wrapper = $('<div />').css(wrapper_css)
    var link = $('<a />', {href: 'https://themequarry.com'})
        .html('Ready to sell your theme? Submit your theme to our new marketplace now and let over 200k visitors see it!')
        .css(link_css)
        .hover(function () {
            $(this).css(link_hover_css)
        }, function () {
            $(this).css(link_css)
        })
    var btn = $('<a />', {
        'class': 'btn btn-default btn-sm',
        href: 'https://themequarry.com'
    }).html('Let\'s Do It!').css(btn_css)
    var close = $('<a />', {
        'class': 'pull-right',
        href: '#',
        'data-toggle': 'tooltip',
        'data-placement': 'left',
        'title': 'Never show me this again!'
    }).html('&times;')
        .css(close_css)
        .click(function (e) {
            e.preventDefault()
            $(wrapper).slideUp()
            if (ds) {
                ds.setItem('no_show', true)
            }
        })

    wrapper.append(close)
    wrapper.append(link)
    wrapper.append(btn)

    $('.content-wrapper').prepend(wrapper)

    wrapper.hide(4).delay(500).slideDown()
});
